import { Link } from "react-router-dom";

function Posts({ data, showData }) {
    console.log(data);
    return (
        <div>
            <table border={1}>
                <thead>
                    <tr>
                        <th>id</th>
                        <th>Title</th>
                        <th>Body</th>
                        <th>Action</th>
                    </tr>
                </thead>
                {!data ? <></> : <tbody>
                    {data.map((item) => {
                        return <tr key={item.id} >
                            <td>{item.id}</td>
                            <td style={{ width: '300px' }}>{item.title}</td>
                            <td style={{ width: '600px' }}>{item.body}</td>
                            <td >
                                <button style={{ padding: '8px' }} onClick={() => showData(item.id)} >More-Info</button>
                                {/* <Link to={'detail'} onClick={() => showData(item.id)}>More-Info</Link> */}
                            </td>
                        </tr>
                    })}
                </tbody>}
            </table>
        </div>
    )
}
export default Posts
